async def handle_query(update, context):
    q = update.callback_query; await q.answer()
    v = get_user_vault(q.from_user.id, q.from_user.username)
    
    if "SET_" in q.data:
        val = int(q.data.split("_")[1]); context.user_data['stake'] = val
        await q.edit_message_text(f"‚úÖ <b>STRIKE LOADED: ${val}</b>")
    
    elif "INT_" in q.data:
        idx = int(q.data.split("_")[1]); target = OMNI_STRIKE_CACHE[idx]
        kb = [[InlineKeyboardButton("üí• EXECUTE ATOMIC STRIKE", callback_data=f"EXE_{idx}")]]
        await q.edit_message_text(f"üéØ <b>TARGET:</b> {target['q']}", reply_markup=InlineKeyboardMarkup(kb), parse_mode='HTML')
    
    elif "EXE_" in q.data:
        idx = int(q.data.split("_")[1]); target = OMNI_STRIKE_CACHE[idx]
        stake = float(context.user_data.get('stake', 10))
        allowance = await asyncio.to_thread(usdc_e_contract.functions.allowance(v.address, CTF_EXCHANGE).call)
        
        if allowance < (stake * 1e6):
            kb = [[InlineKeyboardButton("üîì APPROVE CONTRACT", callback_data="APPROVE_CONTRACT")]]
            await context.bot.send_message(q.message.chat_id, "‚ö†Ô∏è <b>USDC.e PERMISSION REQ.</b>", reply_markup=InlineKeyboardMarkup(kb), parse_mode='HTML')
            return
        
        try:
            client = init_clob_for_vault(v)
            order_args = MarketOrderArgs(token_id=str(target['token_id']), amount=stake, side=BUY, price=0.999)
            signed = await asyncio.to_thread(client.create_order, order_args)
            resp = await asyncio.to_thread(client.post_order, signed, OrderType.FOK)
            await context.bot.send_message(q.message.chat_id, "üöÄ <b>STRIKE SUCCESS!</b>" if resp.get("success") else f"‚ùå <b>FAILED:</b> {resp.get('errorMsg')}", parse_mode='HTML')
        except Exception as e: await context.bot.send_message(q.message.chat_id, f"‚ö†Ô∏è <b>SDK ERROR:</b> {str(e)}", parse_mode='HTML')

    elif q.data == "APPROVE_CONTRACT":
        m = await q.edit_message_text("üîì <b>AUTHORIZING...</b>", parse_mode='HTML')
        try:
            # Build and sign locally using the specific user's vault
            tx = usdc_e_contract.functions.approve(CTF_EXCHANGE, 2**256 - 1).build_transaction({
                'from': v.address,
                'nonce': w3.eth.get_transaction_count(v.address),
                'gas': 80000,
                'gasPrice': w3.eth.gas_price
            })
            signed_tx = w3.eth.account.sign_transaction(tx, v.key)
            tx_hash = w3.eth.send_raw_transaction(signed_tx.rawTransaction)
            await m.edit_text(f"‚úÖ <b>USDC.e APPROVED!</b>\nHash: <code>{tx_hash.hex()[:20]}</code>", parse_mode='HTML')
        except Exception as e: await m.edit_text(f"‚ùå <b>FAILED:</b> {str(e)[:40]}")

